import React from 'react'
import { SafeAreaView, Text, View, StyleSheet, Button, TextInput } from 'react-native';
import WeatherDetails from './WeatherDetails';







export default function HomeScreen({ navigation }) {  
  function change()
  {
    navigation.navigate('Profile', { name: 'Jane' });
    
    
  }
    return (
      <>
    <WeatherDetails city={{name:'Washington'}} ></WeatherDetails>
      <Button
        title="See Weather Details"
        onPress={() =>navigation.navigate('Weather Info', { name: 'Jane' })
          
        }
      />
      </>
      
    );
  };
